import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, Navbar } from 'react-bootstrap';
import '../style/index.css';

class Navbars extends React.Component {
  render() {
    return (
      <div>
        <Navbar bg="dark" variant="light" className="navbarStyle d-none">
          <Navbar.Brand>
            <Link to="/" className="mainLink">鍵盤買賣</Link>
            </Navbar.Brand>
          <Nav className="mr-auto">
            <Link className="link" to="/product" href="#">產品資訊</Link>
            <Link className="link" to="/warranty">保固服務</Link>
            <Link className="link" to="/info">最新資訊</Link>
            <Link className="link" to="/aboutus">關於我們</Link>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default Navbars;
